    contribution represented by the refund was reported as unitemized on the 3/20/14
    monthly report: Michigan RPAC $ 60.00 on 3/13/14 orig recd on 2/27/14.  The disbursements
    to Michigan RPAC for $100.00 on 3/12/14 and Nevada RPAC for $13.50 on 3/27/14
    represent refunds for a transmission of funds inadvertently sent in error by the
    respective state agents.\n"
